import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
     <div className="main-div">
      <h1>The new way to hire event space in the countryside</h1>
      <h2>Sign up to hear updates</h2>
     </div>
    </div>
  );
}

export default App;
